import React from 'react'
import './SearchHistory.css'
const SearchHistory = (props) => {

    const history = props.searchTerms.map((item, index) =>
        <li key={index}>{item}</li>.join("")
    )

    return (
        <div className='history'>   
        { history }
        </div>

    )
}

export default SearchHistory
